import React from 'react';
import logo from './logo.svg';
import './App.css';
import Color from "./Color";
import {Button} from "@material-ui/core";

function App() {
    const [spin, setSpin] = useState(false);

    return (
        <div className="App">
            <Color style={{background: 'red'}}/>
            <Button onClick={() => {
                setSpin(true)
            }}>Spin</Button>
        </div>
    );
}

export default App;
